                return (< Cards
                         img={cards.img} 
                         rating={cards.stats.rating} 
                         reviewcount={cards.reviewCount} 
                         location={cards.location} 
                         price={cards.price} />)
        })
return(
        <div>
            {allData}
        </div>

)}
